import '../styles/Navbar.css'
import { Link } from 'react-router-dom';
const Navbar = () => {
    return (
        <div >
            <ul className="navbar navbar-expand-lg navbar-dark bg-dark">
                <Link  to='/page1'> Trainees </Link>
                <Link class="nav-link" to='/page2'> Academies </Link>
                <Link class="nav-link" to='/page3'> Trainers </Link>
               
                
        </ul>
        </div>

    )


}
export default Navbar
